let uij = 0;
let lij = 0;
let ui = 0;
let li = 0;
let informationLoss = 0

// get the min and max values per categorie. Skip the first as its the name in the transposed array.
for (let i = 1; i < dataframe.length; i++) {
    for (let key = 0; key < quasiIdentifiers.length; key++) {
        const category = dataframe[i][equivalenceClassColumn];
        const filtered_array = dataframe.filter((value) => value[equivalenceClassColumn] === category).map((value => value[key]));
        uij = Math.max.apply(Math, filtered_array);
        lij = Math.min.apply(Math, filtered_array);

        const filtered_general_array = dataframe.slice(1).map(value => value[key]);
        ui = Math.max.apply(Math, filtered_general_array);
        li = Math.min.apply(Math, filtered_general_array);
        informationLoss = informationLoss + ((uij - lij) / (ui - li))
    }
}
let factor = 1 / (quasiIdentifiers.length * dataframe.slice(1).length)
let result = factor * informationLoss
metric = result

node.warn({"informationLoss": informationLoss});
node.warn({"generalized_information_loss": result});

return msg;

