var isInFilterCounter = 0;
for (var prop in filterCondition) {
    var currentFilter = filterCondition[prop]
    if(prop === "rangeFilter") {
        if( msg.payload[currentFilter.columnName] >= currentFilter.minValue && msg.payload[currentFilter.columnName] <= currentFilter.maxValue) {
            isInFilterCounter += 1;
        }
    }
    if (prop === "whitelistFilter") {
        if(currentFilter.whitelistValues.includes(msg.payload[currentFilter.columnName])) {
            isInFilterCounter += 1;
        }
    }
    if (prop === "blacklistFilter") {
        if(!currentFilter.blacklistValues.includes(msg.payload[currentFilter.columnName])) {
            isInFilterCounter += 1;
        }
    }
}


if (isInFilterCounter == Object.keys(filterCondition).length) {
    return msg;
